import React from "react";

import { Link } from 'react-router-dom'

import Business_icon from '../../1_image_or_icon/cooking-chef-cap-icon.png'

export const Registration_Default_Page = () => {

    return <React.Fragment>
    
    <div
    style={{
    width:'inherit',
    height:'inherit',
    
    display:'flex',
    flexDirection:'row',

    justifyContent:'center',
    alignItems: 'center'
    }}
    >

        <div
        style={{
        display:'flex',
        flexDirection:'row'
        }}
        >

            <span>
                <div
                style={{
                
                height:'15vh',
                
                padding:'2vh 4vw',

                display:'flex',
                flexDirection:'column',
                justifyContent:'space-around',
                alignItems: 'center',

                textAlign: 'center',

                border: 'black solid 3px',
                borderRadius: '15px',

                fontSize: '3vw'
                }}
                >
                    <img
                    src= {Business_icon}
                    style={{
                    width: '15vw'
                    }}
                    ></img>
                    <span>
                    Create Account <br></br> For Business
                    </span>
                </div>


            </span>

            <span>
                <div
                style={{
                
                height:'15vh',
                
                padding:'2vh 4vw',

                display:'flex',
                flexDirection:'column',
                justifyContent:'space-around',
                alignItems: 'center',

                textAlign: 'center',

                border: 'black solid 3px',
                borderRadius: '15px'
                }}
                >
                    <img
                    src= {Business_icon}
                    style={{
                    width: '15vw'
                    }}
                    ></img>
                    <span>
                    Create Account <br></br> For Business
                    </span>
                </div>


            </span>


        </div>


    </div>

    </React.Fragment>

}

export default Registration_Default_Page;
